Looks Can Be Deceiving...
&quot;Pamela&quot; is an Argentinian beauty who has all the &quot;right assets&quot; to make it as a model in New York -- as long as no one discovers her shocking secret. Rising quickly in the high-gloss world of sexy models and horny shutterbugs, &quot;Pamela&quot; takes charge of every situation with her lusty Latin charms. She jumps head-first into a torrid affair with a delicious female photographer, Ashley, who turns &quot;Pamela&quot; into the toast of Manhattan -- and keeps &quot;Pamela's&quot; secret safe from the world. But when a rival agency tries to reveal the truth about &quot;Pamela&quot;, they set the stage for one of the most unusual climaxes in erotic film history... a climax that takes us on the unbelievable Passage Thru Pamela!

